import React, { useRef } from "react";
import { FaArrowDown } from "react-icons/fa";

const imageBasePath = "/static/frontend/images/";

export default function Home() {
  const productsRef = useRef(null);
  const quoteRef = useRef(null);

  const scrollToSection = (ref) => {
    ref.current?.scrollIntoView({ behavior: "smooth" });
  };

  return (
    <div className="flex flex-col min-h-screen font-sans">
      {/* Navigation Bar */}
      <nav className="bg-gray-900 text-white flex justify-between px-6 py-4">
        <div className="text-2xl font-bold">
          <img
            src={`${imageBasePath}jendyco-logo2.png`}
            alt="Logo"
            className="h-10 inline"
          />
        </div>
        <div className="flex space-x-6 items-center">
          <button
            onClick={() => scrollToSection(productsRef)}
            className="hover:text-orange-500 transition"
          >
            Our Products
          </button>
          <button
            onClick={() => scrollToSection(quoteRef)}
            className="hover:text-orange-500 transition"
          >
            Request a Quote
          </button>
        </div>
      </nav>

      {/* Hero Section */}
      <div
        className="flex flex-col justify-center items-center text-white text-center h-screen bg-cover bg-center"
        style={{ backgroundImage: `url(${imageBasePath}background_main1.png)` }}
      >
        <h1 className="text-4xl md:text-5xl lg:text-6xl font-bold mb-6">
          Global Trade. Local Roots.
        </h1>
        <p className="text-lg md:text-xl max-w-2xl">
          From the heart of Peru to the world â€” trusted sourcing and global exports in coffee,
          cacao, alpaca wool, and more.
        </p>
        <FaArrowDown className="mt-10 animate-bounce text-3xl" />
      </div>

      {/* Our Products Section */}
      <section ref={productsRef} className="bg-white py-16 px-6" id="products">
        <h2 className="text-3xl font-bold text-center text-gray-800 mb-12">
          Our Products
        </h2>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
          {[
            {
              title: "Arabica Coffee Beans",
              desc: "87% purity, shade-grown in the Peruvian highlands."
            },
            {
              title: "Cacao Beans",
              desc: "Premium Criollo and Forastero varieties from small Peruvian farms."
            },
            {
              title: "Pima Cotton",
              desc: "100% Peruvian Pima â€” one of the softest cottons in the world."
            },
            {
              title: "Baby Alpaca Wool",
              desc: "Luxury-quality fiber sourced directly from family farms in the Andes."
            },
            {
              title: "Camu Camu Powder",
              desc: "Rare superfruit from the Amazon with high vitamin C content."
            },
            {
              title: "Lucuma & Maca",
              desc: "Ancient Andean roots and fruits, rising in global health markets."
            }
          ].map((product, i) => (
            <div
              key={i}
              className="bg-gray-100 p-6 rounded-2xl shadow hover:shadow-lg transition"
            >
              <h3 className="text-xl font-semibold text-gray-700 mb-2">
                {product.title}
              </h3>
              <p className="text-gray-600 text-sm">{product.desc}</p>
            </div>
          ))}
        </div>
      </section>

      {/* Quote Section */}
      <section ref={quoteRef} className="bg-gray-100 py-20 px-6">
        <h2 className="text-3xl font-bold text-center text-gray-800 mb-10">
          Request a Quote
        </h2>
        <form className="max-w-2xl mx-auto space-y-4">
          <input
            type="text"
            placeholder="Full Name"
            className="w-full border border-gray-300 p-3 rounded-md"
          />
          <input
            type="email"
            placeholder="Email"
            className="w-full border border-gray-300 p-3 rounded-md"
          />
          <textarea
            rows="4"
            placeholder="Tell us what you're looking for..."
            className="w-full border border-gray-300 p-3 rounded-md"
          ></textarea>
          <button className="bg-orange-500 text-white py-3 px-6 rounded-md hover:bg-orange-600 transition">
            Submit Request
          </button>
        </form>
      </section>

      {/* Footer */}
      <footer className="bg-gray-900 text-white text-center py-6">
        &copy; {new Date().getFullYear()} Jendyco International. All rights reserved.
      </footer>
    </div>
  );
}
